"ans": "- Farmers, Housewives, ex-army and Students are not eligible for the payout\n- Users should not opened too many accounts in the same location on the same day\n- If more then 1 account opened through same mobile number, the Banksathi will be blocked and the payment will be cancelled\n- Only account where users are from Tamilnadu including Pondicherry, Karnataka, Andhara-pradesh,Telangana, Maharastra, Punjab, Chandigarh,Rajasthan,Delhi, Gujarat will be eligible for the payout\n- If video KYC is pending, you will not receive a commission"
}
]

